import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import TabBar from './app/book/tabbar';
import HomeScreen from './app/book/home';
//import TabBar from './app/book/tabbar';
import ErrorScreen from './app/error/error';

const Tab = createMaterialTopTabNavigator();
function App() {
  return (    
    <NavigationContainer>
      <Tab.Navigator tabBar={props => <TabBar {...props} />}>
        <Tab.Screen name="Home" component={HomeScreen} />
        {/* <Tab.Screen name="List" component={SettingsScreen} />
        <Tab.Screen name="Detail" component={ProfileScreen} /> */}
        <Tab.Screen name="Error" component={ErrorScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

export default App;
